import React,{useEffect}from "react";
import { useNavigate,useLocation} from "react-router-dom";

export default function Welcome() {
    const navigate = useNavigate();
    
  return (
    <>
    {!localStorage.getItem('token')?navigate('/welcome'):navigate('/')}
    <div>Welcome</div>
    </>
  )
}
